INSERT INTO `pmsystems` (`ID`, `Company`, `Name`, `AnnualRevenue`, `Certification`, `Website`, `Timestamp`, `Priority`, `Implemented`, `SelectSessions`, `SelectLates`, `SelectToNotify`) VALUES (1,'Best Practice Software','BestPractice 1.8+','?','','http://bpsoftware.com.au','2014-12-11 01:08:24',100,1,'select * from BPS_Sessions where Provider <> \'\'','select a1.Provider, a1.Status, a1.ArrivalTime, a1.AppointmentDate, a1.AppointmentTime, a1.ConsultationTime, 7200 As Horizon \r\nfrom BPS_Appointments a1, BPS_Sessions b1 \r\nwhere a1.AppointmentDate = DATEADD(dd, 0, DATEDIFF(dd, 0, GETDATE()))\r\nand a1.ConsultationTime = \r\n(SELECT MAX(a2.ConsultationTime) FROM BPS_Appointments a2 \r\nWHERE a2.AppointmentDate = a1.AppointmentDate and a2.Provider \r\n= a1.Provider and a2.ConsultationTime != 0)\r\nand a1.Provider = b1.Provider\r\nand b1.Day = datename(dw,getdate())\r\nand b1.EndTime + 7200 > DATEDIFF(s, 0,DATEADD(Day, 0 - DATEDIFF(Day, 0, getdate()), getdate()))\r\n','select a1.Patient, a1.InternalID, a1.AppointmentDate, a1.AppointmentTime, a1.Provider, p.MobilePhone from BPS_Appointments a1\r\ninner join BPS_Patients p on p.InternalID = a1.InternalID\r\ninner join PATIENTS ON PATIENTS.INTERNALID = p.InternalID\r\nwhere a1.ArrivalTime = 0 and a1.Provider = @Provider and p.MobilePhone <> \'\' and PATIENTS.CONSENTSMSREMINDER = 1\r\nand (\r\n (a1.AppointmentDate = @AppointmentDate\r\nand a1.AppointmentTime > @AppointmentTime\r\nand a1.AppointmentTime <= @AppointmentTime + @Horizon)\r\n or\r\n (@AppointmentTime > (84600 - @Horizon) and a1.AppointmentDate = DATEADD(day,1,@AppointmentDate) \r\n  and a1.AppointmentTime < @AppointmentTime - 86400 + @Horizon\r\n )\r\n)\r\nand \r\na1.InternalID NOT IN (select a2.InternalID from BPS_Appointments a2\r\nWHERE a2.InternalID = a1.InternalID\r\nAND a2.Provider <> a1.Provider\r\nAND a2.AppointmentTime < a1.AppointmentTime\r\n)\r\n'),(2,'Medical Director','Medical Director 3.15+','?','','http://hcn.com.au','2014-12-11 01:08:24',100,1,'select * from SESSION where 1 = 0','select a1.PractitionerID, [Name] As Provider, a1.[When] As AppointmentTime, a1.[TimeInWAITROOM] As ArrivalTime, a1.TimeInConsult As ConsultationTime,\r\nDATEDIFF(minute,TimeInWAITROOM, TimeInConsult) As NewLate,\r\n2 As Horizon\r\nfrom APPT a1, PRAC\r\nwhere a1.PractitionerID = PRAC.PractitionerID \r\nand DATEADD(dd, 0, DATEDIFF(dd, 0, [When])) = DATEADD(dd, 0, DATEDIFF(dd, 0, GETDATE()))\r\nand TimeInConsult = \r\n(SELECT MAX(TimeInConsult) FROM APPT a2\r\n WHERE a2.PractitionerID = a1.PractitionerID\r\n and DATEADD(dd, 0, DATEDIFF(dd, 0, a1.[When])) = DATEADD(dd, 0, DATEDIFF(dd, 0, a2.[When])) \r\n and TimeInConsult is not null)\r\nand DATEPART(hour,GETDATE()) <= \r\n  (SELECT MAX(DATEPART(hour,b2.[1End]) + 2)\r\n   FROM SESSION b2\r\n   WHERE b2.DayOfWk = DATEPART(weekday,GETDATE())\r\n   AND (b2.PractitionerID = 0 or b2.PractitionerID = a1.PractitionerID)\r\n  )\r\n','select a1.PatientID, p.SURNAME, a1.[When] As AppointmentDate, p.PHONE_MOBILE As MobilePhone from APPT a1\r\ninner join CM_PATIENT p on p.PATIENT_ID = a1.PatientID\r\nwhere a1.TimeInWAITROOM is null and a1.PractitionerID = @PractitionerID and p.PHONE_MOBILE <> \'\'\r\nand a1.[When] > @AppointmentTime and a1.[When] < DATEADD(hour, @Horizon, @AppointmentTime)\r\n'),(19,'Cerner Corporation','Cerner PowerChart Ambulatory EHR,Cerner Millennium','$2.67 billion*','CCHIT','http://cerner.com','2014-12-11 03:00:23',99,0,'','',''),(20,'Epic Systems Corporation','EpicCare Ambulatory - Core EMR','$1.50 billion*','CCHIT','http://epic.com','2014-12-11 03:00:23',99,0,'','',''),(21,'Allscripts','Allscripts Professional EHR,SunriseClinicalMgr','$1.45 billion','CCHIT','http://allscripts.com','2014-12-11 03:00:23',99,0,'','',''),(22,'NextGen Healthcare Information Systems Inc*','NextGen Ambulatory EHR','$429.8 million','CCHIT','http://nextgen.com','2014-12-11 03:00:23',50,0,'','',''),(23,'athenahealth','athenaClinicals','$422.3 million','Surescripts LLC / CCHIT','http://athenahealth